import React, {Component} from 'react';
import '../public/css/layout.css'


class About  extends Component {

    constructor(props) {
        super(props);
        this.state = {
            name: "James Rundle",
            image: "../public/images/JamesBoeing.jpg",
            bio: "Hi" +
                "I am" +
                "James\n" +
                "I like programming!",
            street: "437 North Maxwell",
            city: "McPherson",
            state: "Kansas",
            zip: "67460",
            address : { street : "437 North Maxwell",
                        theRest : "McPherson, KS 67460"},
            phone: "816-679-3017",
            email: "jamesamrundle@gmail.com"
        }
    }

    render() {
        let {bio,street,city,state,address,zip,phone,email,name,image} = this.state;
        return (
            <section>
            <div className="row">
                <img className="profile-pic" src="./redhat.jpg"/>
                <div>
                    <h2>About Me</h2>
                    <p>{bio}</p>
                </div>
                <div>
                    <h2>Contact Details</h2>
                    <p>
                        <span>{name}</span>
                        <span>{address.street}</span>
                        <span>{address.theRest}</span>
                        <br/>
                        <span>{phone}</span>
                        <span>{email}</span>
                    </p>
                </div>
            </div>
            </section>
        );
    }
}

export default About;
